import Axios from 'axios';
import "./App.css";

function Login() {
  const[users,setUsers] = React.useState([]);
  var text = '';
  var usernameInput = '';
  var passwordInput = '';
  
  useEffect(() => {
    Axios.get("http://localhost:8800/logins").then((response) => {
      setUsers(response.data);
    })
  })

  const Login = () => {
    text = usernameInput;
  }

    return (
      <div>
        <h1>Login</h1>
        <div className ="form">
          <label>Username:</label>
          <input type ="text" placeholder='Username' onChange = {(e) => {usernameInput = e.target.value}}/>
          <label>Password:</label>
          <input type ="text" placeholder='Password' onChange = {(e) => {usernameInput = e.target.value}}/>
        </div>
        <button onClick = {Login()}>Login</button>
        <div style = {{color : 'red'}}>{text}</div>
      </div>
    );
  };


export default Login;
